import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
    mainImage: {
        maxHeight: '300px',
        maxWidth: 'auto',
        display: "block",
        textAlign: 'center',
    },
    lien:{
        'position': 'relative',
    },
    blocLien:{
        "position":"absolute"
    }

}))
const MonEspaceLinks = ({ section = {} }) => {
    const classes = useStyles()
    return (
        <>
            <Link className={classes.blocLien} href={section.route}>
                <a className={classes.lien}>
                    <img
                        className={classes.mainImage}
                        src={section.picto}
                        alt="mobilite"
                    />
                    <span>test</span>
                </a>

            </Link>
        </>

    )
}

export default MonEspaceLinks
